import React from 'react';

function About() {
  return (
    <div className="container">
      <h1>About Filemater Pro</h1>
      <p>Filemater Pro is a free, all-in-one web application designed to simplify your file management tasks. Convert, resize, and compress various file types with ease, directly from your browser, without any sign-up or hidden costs.</p>
      <p>Our goal is to provide a fast, secure, and user-friendly experience for all your file processing needs.</p>
      <p>Built with React.js for the frontend and Node.js/Express for the backend.</p>
    </div>
  );
}

export default About;
